import React from "react";
import { Link } from "react-router-dom";
import "./FoodMenu.css";
import {
  Card,
  CardBody,
  CardTitle,
  CardText,
  ListGroup,
  ListGroupItem
} from "reactstrap";

function FoodMenu({ snacks, drinks }) {
  return (
    <section className="col-md-4">
      <Card>
        <CardBody>
          <CardTitle tag="h5" className="font-weight-bold text-center">
            Food Menu
          </CardTitle>
          <CardText>
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </CardText>
          <ListGroup flush>
            {snacks.map(snack => (
              <Link to={`/snacks/${snack.id}`} key={snack.id}>
                <ListGroupItem action tag="button">
                  {snack.name}
                </ListGroupItem>
              </Link>
            ))}
          </ListGroup>

        </CardBody>
      </Card>
<Card>
        <CardBody>
          <CardTitle tag="h5" className="font-weight-bold text-center">
            Drink Menu
          </CardTitle>
          <CardText>
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </CardText>
          <ListGroup flush>
            {drinks.map(drink => (
              <Link to={`/drinks/${drink.id}`} key={drink.id}>
                <ListGroupItem action tag="button">
                  {drink.name}
                </ListGroupItem>
              </Link>
            ))}
          </ListGroup>

        </CardBody>
      </Card>
    </section>
  );
}

export default FoodMenu;
